import { Typeahead } from "react-bootstrap-typeahead";
import { actorPeliculaDTO } from "./actores.model";

export default function TypeAheadActores(props: typeAheadActoresProps){

    const actores: actorPeliculaDTO[] = [
        {id: 1, nombre: 'Felipe', personaje: '', foto: 'data:image/jpeg;base64,'}, 
        {id: 2, nombre: 'Fernando', personaje: '', foto: 'data:image/jpeg;base64,'},
        {id: 3, nombre: 'Roberto', personaje: '', foto: 'data:image/jpeg;base64,'}
    ]
    return(
        <>
            <label>Actores</label>
            <Typeahead id="typeahead" onChange={actor => {
                console.log(actor);
                }}
                options={actores}
                labelKey={actor => actor.nombre}
                filterBy={['nombre']}
                placeholder = "Escriba el nombre del actor..."
                minLength={2}
                flip={true}
            />
        </>
    )
}

interface typeAheadActoresProps{
    actores: actorPeliculaDTO[];
}